import { useState } from 'react'

let id = 0
export const [historyElements, setHistoryElements] = useState([])
export const [command, setCommand] = useState('')
const handleInput = (e) => {
setCommand(e.target.value)
}

export function addHistoryElement() {
id += 1
setHistoryElements([
    ...historyElements,
    {id: id, command: command, result: handleCommand(command)}
])
}
